import React from 'react';

const Hiking = ({ imageUrl, height, width }) => {
  const containerStyle = {
    background: `url(${imageUrl})`, // Use the imageUrl prop here to set the background image
    backgroundSize: 'cover',
    backgroundPosition: 'right',
    backgroundRepeat: 'no-repeat',
    position: 'relative',
    zIndex: -1,
    width: width ? width : "750px", // If width prop is provided, use it; otherwise, use the default value "750px"
    height: height ? height : '500px', // If height prop is provided, use it; otherwise, use the default value "500px"
  };

  const imageCreditStyle = {
    position: 'relative',
    bottom: '10px',
    right: '10px',
    background: 'rgba(0, 0, 0, 0)',
    color: '#000',
    padding: '25px 500px',
    fontSize: '10px',
    borderRadius: '4px',
    marginLeft: "100px"
  };

  return (
    <div>
      <div style={containerStyle} />
      <div style={imageCreditStyle}>
        Image by storyset on Freepik
      </div>
    </div>
  );
}

export default Hiking;
